/*Table structure for table `login` */

DROP TABLE IF EXISTS `login`;

CREATE TABLE `login` (
  `id_login` int(10) NOT NULL AUTO_INCREMENT,
  `id_user` int(10) NOT NULL,
  `username` varchar(40) NOT NULL,
  `password` varchar(40) NOT NULL,
  `user_role` enum('Admin','Karyawan','Pengunjung') NOT NULL,
  PRIMARY KEY (`id_login`),
  KEY `get_user_id` (`id_user`),
  CONSTRAINT `get_user_id` FOREIGN KEY (`id_user`) REFERENCES `user` (`id_user`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=106 DEFAULT CHARSET=utf8mb4;

