/*Table structure for table `proyek` */

DROP TABLE IF EXISTS `proyek`;

CREATE TABLE `proyek` (
  `id_proyek` int(11) NOT NULL AUTO_INCREMENT,
  `id_user` int(11) NOT NULL,
  `nama_proyek` varchar(255) NOT NULL,
  `harga_awal` int(30) NOT NULL,
  `diskon` int(3) NOT NULL,
  `total_harga` int(30) NOT NULL,
  `gambar1` blob NOT NULL,
  `gambar2` blob NOT NULL,
  PRIMARY KEY (`id_proyek`),
  KEY `get_user` (`id_user`),
  CONSTRAINT `get_user` FOREIGN KEY (`id_user`) REFERENCES `user` (`id_user`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=14 DEFAULT CHARSET=utf8mb4;

